import React, { useCallback, useEffect, useState } from "react";

function NewComponent() {
  const port = 8081;

  const [medicalPrescription, setMedicalPrescription] = useState({});
  const [ws, setConnected] = useState({});

  useEffect(() => {
    fetch(
      "/api/v1/orders/medical-prescriptions/1b9d6bcd-bbfd-4b2d-9b5d-ab8dfbbd4bed",
      {
        headers: new Headers({
          Authorization:
            "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJvcmRlcktleSI6IjFiOWQ2YmNkLWJiZmQtNGIyZC05YjVkLWFiOGRmYmJkNGJlZCIsImlhdCI6MTY2NjEyNzQ4MSwiZXhwIjoxNjY4NzE5NDgxLCJhdWQiOiJqd3Qtb3JkZXIta2V5In0.RrXOmFs6G7kcoPbau3nObQSrEmLuzk3wHHhtohjaH2U",
        }),
      }
    )
      .then((res) => res.json())
      .then((medicalPrescription) => {
        setMedicalPrescription(medicalPrescription);
      });
  }, []);

  useEffect(() => {
    console.log("Tu");
    const ws = new WebSocket(
      `ws://localhost:${port}/api/v1/orders/medical-prescriptions/1b9d6bcd-bbfd-4b2d-9b5d-ab8dfbbd4bed`
    );

    setConnected(ws);

    return () => ws.close();
  }, []);

  // console.log("Websocket listen on port: ", port);

  // console.log("Websocket listen on ws: ", ws);

  ws.onmessage = function (event) {
    const json = JSON.parse(event.data);
    console.log("Websocket received message: ", json.data);
    try {
      if ((json.event = "data")) {
        setMedicalPrescription(json.data);
      }
    } catch (err) {
      console.log(err);
    }
  };

  return (
    <table className="App-header">
      <tbody>
        <tr>
          <td className="App-link td">orderKey: </td>
          <td>{medicalPrescription?.orderKey}</td>
        </tr>

        <tr>
          <td className="App-link td">fullname: </td>
          <td>{medicalPrescription?.patient?.fullname}</td>
        </tr>

        <tr>
          <td className="App-link td">identificationNumber: </td>
          <td>{medicalPrescription?.patient?.identificationNumber}</td>
        </tr>

        <tr>
          <td className="App-link td">medicineName: </td>
          <td>{medicalPrescription?.patient?.medicineName}</td>
        </tr>

        <tr>
          <td className="App-link td">state: </td>
          <td>{medicalPrescription?.state}</td>
        </tr>

        <tr>
          <td className="App-link td">smsPrice: </td>
          <td>{medicalPrescription?.smsPrice}</td>
        </tr>

        <tr>
          <td className="App-link td">createdAt: </td>
          <td>{medicalPrescription?.createdAt}</td>
        </tr>

        <tr>
          <td className="App-link td">smsState: </td>
          <td>{medicalPrescription?.smsState}</td>
        </tr>

        <tr>
          <td className="App-link td">smsResponseSentAt: </td>
          <td>{medicalPrescription?.smsResponseSentAt}</td>
        </tr>
      </tbody>
    </table>
  );
}

export default NewComponent;
